import { Component } from "react";
import "bootstrap/dist/css/bootstrap.css";

export class userProfile extends Component {
  constructor(props) {
    super(props);

    this.refreshlist = this.refreshlist.bind(this);

    this.state = {
      userData: [],
      agmUnit: "",
      dgmUnit: "",
      serviceUnit: "",
      username: "",
    };
  }

  componentDidMount() {
    this.refreshlist();
  }

  refreshlist() {}

  render() {
    const { userData, agmUnit, dgmUnit, serviceUnit, username } = this.state;

    return (
      <div classNameName="container">
        <h1 className="text-center">Heading</h1>
        <div className="card">
          <div className="card-header d-flex">
            <h5 id="username" className="mb-0">
              Heading
            </h5>
            &nbsp;&nbsp;&nbsp;&nbsp;
            <h5 className="text-end d-inline float-end mb-0" id="epfno">
              Heading
            </h5>
          </div>
          <div className="card-body">
            <div className="table-responsive">
              <table className="table">
                <thead>
                  <tr className="text-success">
                    <th>Casual</th>
                    <th>Annual</th>
                    <th>Medical</th>
                    <th>Duty</th>
                    <th>Lieu Leave</th>
                    <th>No pay</th>
                    <th>Maternity</th>
                  </tr>
                </thead>
                <tbody>
                  <tr>
                    <td>
                      <label className="form-label">Label</label>
                      <label className="form-label" id="casualNo"></label>
                    </td>
                    <td></td>
                    <td></td>
                    <td></td>
                    <td></td>
                    <td></td>
                    <td></td>
                  </tr>
                  <tr></tr>
                </tbody>
              </table>
            </div>
          </div>
        </div>
      </div>
    );
  }
}
